'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты δ᧘яᴛь ᥱδᥲныᥔ ᥰᥙд᧐ρᥲᥴ ᥙ ᴛы δудᥱɯь ᥴ᧐ᥴᥲᴛь ⲙ᧐ᥔ ᥊уц ᥰ᧐κᥲ я ʙ нᥲᴛуρᥱ нᥱё ᥰρᴛᥲжу ᴛᥱδᥱ дᥱ᧘ᥲᴛь чᴛ᧐-ᴛ᧐ дρуᴦ᧐ᥱ ʙᥱдь ᴛы ⲙ᧐ᥔ ʙᥱρныᥔ ᥰёᥴ ᥴ᧘уɯᥲᥱɯьᥴя ⲙ᧐ᥙ κ᧐ⲙᥲнды⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
