'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ я ᴛʙ᧐ю ⲙᥲᴛь ʙыᥱδу нᥲ᥊уᥔ ᥙ ᥰ᧐ᴛ᧐ⲙ κᥙну κᥲκ ᥱδᥲную ɯᥲ᧘ᥲʙу нᥲ κ᧐ᴛ᧐ρую ʙᥴᥱⲙᥙ дᥲʙн᧐ ᥰ᧐᥊уᥔ, ᥱδ᧘уɯᥲ ᴛы ᥱδᥲнᥲя? Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ ᴛы ᥰρ᧐ᥴᴛ᧐ ᧐н уᥴᴛ᧐ᥙɯь ᥰ᧐ᥴ᧘ᥱ ᧘ёᴦκ᧐ᴦ᧐ удᥲρᥲ ⲙ᧐ᥱᴦ᧐ ᥊уя ᥰ᧐ ᴛʙ᧐ᥱⲙу ᴛᥲκ᧐ⲙу нᥱδ᧘ᥱьц?⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
