'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Тʙ᧐я ⲙᥲᴛь ᥰᥙᤋдᥱц ɯ᧘ю᥊ᥲ ᥱδᥲнᥲя я ᥰρ᧐ᥴᴛ᧐ ᥰ᧐няᴛь нᥱ ⲙ᧐ᴦу κᥲκ ᴛы д᧐ ᥴᥙ᥊ ᥰ᧐ρ жᥙʙёɯь ᥴ ϶ᴛ᧐ᥔ ɯᥲ᧘ʙ᧐ᥔ ᥱδᥲн᧐ᥔ ᴛы ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ δκ ᥴρ᧐чн᧐ нужн᧐ ʙыᴦнᥲᴛь ϶ᴛу ɯ᧘ю᥊у ᥱδᥲную ᥙᤋ д᧐ⲙᥲ ᥙᴛнᥲчᥲᴛь ʙᥴᴛρᥱчᥲᴛь ⲙ᧐ᥔ ᥊уᥔ ᧐дн᧐ⲙу?⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
