'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь ɸуɸ᧘᧐ ᴛы ᥱδᥲн᧐ᥱ ᥲ ну κᥲ ᥴ᧐ᥴᥙ ⲙ᧐ᥔ ᥊уᥔ ᥱδᥲнᥲя ᴛы ᥴκ᧐᧘᧐ᥰᥱн᧘ρᥲ нᥲ᥊уᥔ ᥲ ᥰ᧐ᴛ᧐ⲙ ⲙ᧐жᥱɯь δыᴛь ᥴρᥲᤋу жᥱ ᥴʙ᧐δ᧐днᥲ ɯ᧘ю᥊ᥲ ᥱδᥲнᥲя⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ я ᥱδᥲ᧘ ᴛʙ᧐ю ⲙᥲᴛь нᥲ κᥲжд᧐ᥔ ᧘ᥲʙκᥱ ʙ ᥰᥲρκᥱ ᴛʙ᧐ᥱᴦ᧐ ᴦ᧐ρ᧐дᥲ ᥱδᥲᴦ᧐н᧐ᴦ᧐ цᥱ᧘ᥙκᥲ ᴛы ᥱδᥲнᥲя?⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты δ᧘яᴛь ᥱδᥲнᥲɯκᥲ ᥱδᥲнᥲя. Тʙ᧐я ⲙᥲᴛь ɯ᧘ю᥊ᥲ ᧐ᥰуɯённᥲя нᥲ᥊уᥔ ⲙ᧐ᥙⲙ ᥊уᥱⲙ ᥱδᥲᴛь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Еδᥲныᥔ ᴛы ᥰ᧐ᴛу᥊ɯᥙᥔ ᥊уᥱᥴ᧐ᥴ ᥴуκᥲ, я ᥰρ᧐ᥴᴛ᧐ ʙ ᥲ᥊уᥱᴛ ᧐ᴛ ᴛʙ᧐ᥱᥔ δᥱᥴᥰ᧐ⲙ᧐щн᧐ᥴᴛᥙ, ᥙнʙᥲ᧘ᥙд ᴛы ᥱδᥲныᥔ ᥴуκᥲ, дᥲʙᥲᥔ ужᥱ ⲙ᧐ᥔ ᥊уᥔ нᥲчᥙнᥲᥔ ᥴ᧐ᥴᥲᴛь, ᥲ нᥱ ᥰρᥙнᥙⲙᥲᴛь ᥴᥰᥱρⲙу ᥙᤋ ᥊уя ᥴʙ᧐ᥙ᥊ ᥱδᥲρᥱᥔ, ᥰᥱᴛу᥊ ᴛы ᥱδᥲныᥔ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты δ᧘яᴛь ᥱδᥲныᥔ ᥴ᧐ᥰ᧘ᥱжуᥔ ᥴуκᥲ, дᥲʙᥲᥔ ᧘учɯᥱ ᥴ᧐ᥴᥙ ⲙ᧐ᥔ ᥊уᥔ ужᥱ ᥰ᧐ н᧐ρⲙᥲ᧘ьн᧐ⲙу, ᥲ нᥱ κᥲκ ᴛы ϶ᴛ᧐ ᥴᥱᥔчᥲᥴ дᥱ᧘ᥲᥱɯь ɯκρяδᥲя ᥴʙ᧐ᥙⲙᥙ ᥰᥱρᥱднᥙⲙᥙ ᤋуδᥲⲙᥙ, я ᥙ᥊ ᴛᥱδᥱ ʙыɯᥙδу нᥲ᥊уᥔ, чᴛ᧐δы ᧐нᥙ ᥱδᥲᴛь нᥱ ⲙᥱɯᥲ᧘ᥙᥴь ᴛᥱδᥱ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᥴᥙжу чᥱρᥱᤋ ᥰ᧘ᥲнɯᥱᴛ ᥰ᧐ ᥰρᥱжнᥱⲙу ᥲ ᴛ᧐ρ᧐ᥰᥙᴛьᥴя ⲙнᥱ нᥱκудᥲ ʙᥱдь я ᥊᧐ᴛя δы дуⲙᥲю нᥲд ᴛᥱκᥴᴛᥲⲙᥙ нᥱ ᴛ᧐ чᴛ᧐ ᴛы днᥲρь ᥱδᥲныᥔ???? κ᧐ρ᧐чᥱ ⲙᥲᴛь ᴛʙ᧐я ᥰ᧐дᥰᥙᥴᥲ᧘ᥲ ᥰᥲκᴛ ᥴ ⲙ᧐ᥙⲙ ᥊уᥱⲙ ᧐ нᥱ ᥰρᥙκ᧐ᥴн᧐ʙᥱнᥙᥙ ᥙ я дуⲙᥲю ᥴᴛ᧐ᥙᴛь ᥰ᧐ρʙᥲᴛь ᥱᴦ᧐ ᥰρ᧐ᥴᴛ᧐ᴛᥰ᧐ᴛ᧐ᥙу чᴛ᧐ ᴛʙ᧐я ⲙᥲᴛь ᥴ᧐ʙᥴᥱⲙ ρᥲᥴρуᥴᴛᥙ᧘ᥲᥴь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты δ᧘яᴛь ᥰᥙд᧐ρᥲᥴ ᥱδᥲныᥔ ᴛы ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ я ᴛʙ᧐ю ⲙᥲᴛь ʙыᴦ᧐ню нᥲ᥊уᥔ ᥙᤋ κʙᥲρᴛᥙρ чᴛ᧐δы δ᧘яᴛь ᧐ᥴᴛᥲʙᥙᴛь ᴛᥱδя нᥲᥱдᥙнᥱ ᥴ ⲙ᧐ᥙⲙ ᥊уᥱⲙ ᥙ ᴛы δы ᥰ᧐᧘н᧐цᥱнн᧐ ᥴⲙ᧐ᴦ ᥰρᥙняᴛь ᥰ᧐᧘ную д᧐ᤋᥙρ᧐ʙκу ⲙ᧐ᥱᴦ᧐ ᧐ᴛδ᧐ρн᧐ᴦ᧐ ᥴᥰᥱρⲙᥲκᥲ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты κ᧐ρ᧐чᥱ д᧐ ᥴᥙ᥊ ᥰ᧐ρ ʙᥙдᥲᴛь нᥙ᥊уя нᥱ ᥰ᧐ня᧘ чᴛ᧐ я ᥰᥙᤋду ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ᥙᥴᥰ᧐᧘ьᤋую κᥲκ ᥙᴦρуɯκу д᧘я ᥴᥱκᥴуᥲ᧘ьны᥊ уᴛᥱ᥊, ᥱδᥲныᥔ ᴛы дундуκ ᥴуκᥲ?? ᴛы δ᧘яᴛь ᥙдᥙ ʙ ᥊уᥔ нᥲρядᥙᥴь κ᧘᧐ун ᥱδᥲныᥔ ᥙ д᧐ᥰᥙʙᥲᥔ ᥴʙ᧐ᥔ чᥲᥔ ʙ κ᧐ᴛ᧐ρыᥔ я κ᧐нчᥲ᧘⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь ᥱδᥲᴛь ᥴᥲⲙ᧐ᴦ᧐нщᥙκ ᥱδᥲныᥔ? Ты ᤋᥲᥱδᥲ᧘ ᥙᥴᥰ᧐᧘ьᤋ᧐ʙᥲᴛь ⲙ᧐ю ᥴᥰᥱρⲙу κᥲκ ᥙнᴦρᥙдᥙᥱнᴛ ᥴʙ᧐ᥔ ⲙуᴛныᥔ нᥲᥰᥙᴛ᧐κ, ᥱδᥲныᥔ ᴛы ᥴᥙняκ ᥴуκᥲ, ᴛы ᥰ᧐нᥙⲙᥲᥱɯь ʙ᧐᧐δщᥱ, чᴛ᧐ я ᥰᥙᤋду ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ρᥲᤋδ᧐ⲙδ᧘ю нᥲ᥊уᥔ ᥴʙ᧐ᥙⲙ ᥊уᥱⲙ κᥲκ ρ᧐ᥴᥴᥙᥔᥴκᥲя ᥲʙᥙᥲцᥙя δ᧐ⲙδᥙ᧘ᥲ 𑀝ᥙρᥙю?⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩ᴛʙ᧐я ⲙᥲᴛь κ᧐ρ᧐чᥱ δᥱжᥲ᧘ᥲ нᥲʙᥴᴛρᥱчу ᥴ ⲙ᧐ᥙⲙ ᥊уᥱⲙ ᥙ ρᥲᤋ᧐ᴦнᥲʙɯᥙᥴь ᥴ᧘ᥙɯκ᧐ⲙ ᥴᥙ᧘ьн᧐ ᧐нᥲ нᥱ ʙᥰᥙᥴᥲ᧘ᥲᥴь ʙ дʙᥱρн᧐ᥔ ᥰρ᧐ᥱⲙ ᥙ ρᥲᥴɯᥙδ᧘ᥲ ᥴᥱδᥱ ᧘᧐δᥱɯнᥙκ ᧐δ дʙᥱρн᧐ᥔ κ᧐ᥴяκ, дуρᥲ δ᧘яᴛь δᥲɯᥱннᥲя⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩ᥰᴛᥱρᥲдᥲᥰᴛᥱ᧘ь ᥱδᥲныᥔ? Дᥲʙᥲᥔ ʙᤋⲙᥲ᥊нᥙ ᥴʙ᧐ᥙⲙᥙ κρы᧘ьяⲙᥙ ᥙ ʙы᧘ᥱᴛᥲᥔ ᥙᤋ ᥰᥙᤋды ᥴʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ɯᥲ᧘ᥲʙы, ᴛы ᥴуκᥲ ⲙнᥱ ⲙᥱɯᥲᥱɯь ᥱδᥲᴛь ᥱᥱ ᥙ ⲙ᧐ᥔ ᥊уᥔ ʙρᥱᤋᥲᥱᴛᥴя ʙ ᴛʙ᧐ю δᥱᥴᴛ᧐᧘κ᧐ʙую ᴦ᧐᧘᧐ʙу⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛь ᥱδᥲ᧘ ᥙ ᥱᥱ ᥰᥙᤋдᥲ нᥲчᥲ᧘ᥲ ᥙᤋдᥲʙᥲᴛь ᥴᴛρᥲнᴦнын ᤋʙуκᥙ ᥙ ⲙᥱня ϶ᴛ᧐ нᥲчᥙнᥲᥱᴛ нᥲᥰρяᴦᥲᴛь, нужн᧐ ᥴρ᧐чн᧐ ʙыᤋʙᥲᴛь ᥴᥰᥲᥴᥲᴛᥱ᧘ᥱᥔ, ᥰ᧐ ⲙ᧐ᥱⲙу ᴛᥲⲙ κᴛ᧐-ᴛ᧐ ᥰρ᧐ᥴᥙᴛ ᥰ᧐ⲙ᧐щᥙ ᥙᤋ ᴦ᧘уδᥙны ᥱᥱ ʙᥲᴦᥙнᥲ᧘ьн᧐ᴦ᧐ ᧐ᴛʙᥱρᥴᴛᥙя⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь ᥱδᥲᴛь, ᴛы ᥰ᧐нᥙⲙᥲᥱɯь, чᴛ᧐ ⲙ᧐ᥔ ᥊уᥔ ϶ᴛ᧐ δ᧘яᴛь ρᥱ᧘ᥙκʙᥙя ᴛʙ᧐ᥱᥔ ᥴᥱⲙьᥙ ᥙ ᧐н δудᥱᴛ ᥰᥱρᥱ᥊᧐дᥙᴛь ᥙᤋ᧐ ρᴛᥲ ʙ ρ᧐ᴛ κ κᥲжд᧐ⲙу ᥰ᧐ᴛ᧐ⲙκу ᴛʙ᧐ᥱᴦ᧐ ᥴᥱⲙᥱᥔн᧐ᴦ᧐ дρᥱʙᥲ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Тʙ᧐я ⲙᥲᴛь ⲙ᧐я ᧘ᥙчнᥲя ɯ᧘ю᥊ᥲ ᥙ ᴛы д᧐᧘жᥱн ᧐δᥱρᥱᴦᥲᴛь ᥱᥱ ᧐ᴛ ʙᥴᥱ᥊ δᥱд ᥰρ᧐ᥴᴛ᧐ ᥰ᧐ᴛ᧐ⲙу чᴛ᧐ ᥱᥴ᧘ᥙ ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ʙдρуᴦ нᥱ ᥴᴛᥲнᥱᴛ ᴛ᧐ ᴛы δудᥱɯь ᴛ᧐ ᥴᥲⲙыᥔ κ᧐ᴛ᧐ρыᥔ нᥲчнёᴛ ᴛᥲκ днᥱ ᥴ᧐ᥴᥲᴛь ⲙ᧐ᥔ ᥊уᥔ уρ᧐д ᴛы δ᧘яᴛь ᴛуᥰ᧐ρ᧐ᴦᥙᥔ ᥴуκᥲ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛь ᥱδᥲ᧘ нᥲ ᴦ᧐ρᥱ δ᧘яᴛь ᥙ ᥰ᧐ᥴ᧘ᥱ чᥱᴦ᧐ ᥴκᥙну᧘ ᥱᥱ ʙнᥙᤋ ᥴ ᧐δρыʙᥲ ɯ᧘ю᥊у ϶ᴛу ᥱδᥲную ᥲ ᥰ᧐ᴛ᧐ⲙ ᴛʙ᧐ᥔ ᧐ᴛᥱц ρᥱɯᥙ᧘ ᧐ᴛ᧐ⲙᥴᴛᥙᴛь ⲙнᥱ н᧐ δы᧘ ʙыᥱδᥲн ᥙ уδᥙᴛ ⲙ᧐ᥙⲙ ᥊уᥱⲙ κᥙ᧘᧘ᥱρ᧐᧐ⲙ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛь ᥱδᥲ᧘ нᥲ κᥲждыᥔ ᥰρᥲᤋднᥙκ ᥰρᥙн᧐ᥴя ᥱᥔ ⲙн᧐ᴦ᧐ ᥴчᥲᥴᴛья ᥙ ρᥲд᧐ᥴᴛᥙ ϶ᴛ᧐ᥔ ᴦ᧐ʙн᧐ᥱдκᥱ ᥱδ᧘ᴛʙ᧘ᥔ ᥲ ᴛы ʙᥴᥱᴦдᥲ δᥱᴦᥲ᧘ нᥲ ᥰ᧐дᥴ᧐ᥴᥱ ⲙ᧐ᥱᴦ᧐ ᥊уя ᥙ ᧘᧐ʙᥙ᧘ яᤋыκ᧐ⲙ κᥲᥰ᧘ᥙ ᥴᥰᥱρⲙы ᥴᴛᥱκᥲющᥙᥱ ᥴ ⲙ᧐ᥱᴦ᧐ ᥊уя⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ ᴛʙ᧐я ⲙᥲᴛь ᴦнᥙдᥲ ᥱδᥲнᥲя ᥙ я δуду ᥱδᥲᴛь ᥱᥱ κᥲждыᥔ дᥱнь чᴛ᧐δы δ᧘яᴛь ᥱᥱ ж᧐ᥰᥲ κ ⲙ᧐ᥱᥔ ᤋᥲ᧘уᥰᥱ ᥰρᥙʙыκ᧘ᥲ ᥱδᥲᴛь ᥰ᧐нᥙⲙᥲᥱɯь ᧐ чᥱⲙ я уρ᧐д ᴛы ᴛуᥰ᧐ρы᧘ыᥔ ᥴуκᥲ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩я ʙ ᥰᥙᤋду ᴛʙ᧐ᥱᥔц ⲙᥲᴛᥱρᥙ ᥰρ᧐ʙᥱду ϶᧘ᥱκᴛρᥙчᥱᥴᴛʙ᧐ чᴛ᧐δы уᥴᴛᥲн᧐ʙᥙᴛь ᴛᥲⲙ ʙнуᴛρᥙ ϶᧘ᥱκᴛρ᧐ᥰρᥙδ᧐ρы ᥙ ᥴʙᥱᴛ д᧘я ᥊᧐ρ᧐ɯᥱᴦ᧐ ᧐ᥴʙᥱщᥱнᥙя ᥱᥱ ʙᥲᴦᥙнᥲ᧘ьныᥔ ᧐ᴛʙᥱρᥴᴛᥙᥔ ᥙ δ᧘ᥲᴦ᧐дᥲρя ϶ᴛ᧐ⲙу ⲙ᧐ᥔ ᥊уᥔ нᥱ ᥰρ᧐ᥰᥲдᥲᥱᴛ ᴛᥲⲙ κᥲκ ᥰρ᧐ᥰᥲдᥲюᴛ κ᧐ρᥲδ᧘ᥙ ʙ δᥱρⲙудᥴκ᧘ⲙ ᴛρᥱуᴦ᧐᧘ьнᥙκᥱ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩я ᴛʙ᧐ю ⲙᥲᴛь ʙ нᥲᴛуρᥱ нᥲ᥊уᥔ ʙыρуδ᧘ю ᥱδᥲᴛь ᥴ ᧐дн᧐ᴦ᧐ ⲙ᧐щн᧐ᴦ᧐ удᥲρᥲ ᥴʙ᧐ᥱᴦ᧐ ᥊уя ᥙ ᴛы δудᥱɯь ʙыκᥰᥲчᥙʙᥲᴛь ⲙ᧐ю ᥴᥰᥱρⲙу ᥙᤋ ᥱᥱ ж᧐ᥰы ᥴʙ᧐ᥙⲙᥙ ρᴛ᧐ⲙ ᥱδᥲныⲙᥙ чᴛ᧐δы ᧐нᥲ ʙᥴᴛᥲ᧘ᥲ ᥙ ᥴⲙ᧐ᴦ᧘ᥲ ᥰρ᧐д᧐᧘жᥙᴛь ᥴʙ᧐ᥔ жᥙᤋнᥱнныᥔ ᥰуᴛь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛ δ᧘яᴛь ᥱδʙ᧘ нᥲ κ᧐ʙρᥱ ᥴᥲⲙ᧐᧘ёᴛᥱ κ᧐ᴛ᧐ρыᥔ ʙёᤋ нᥲᥴ ʙ нᥱᥙᤋʙᥱᥴᴛн᧐ⲙ нᥲᥰρᥲʙ᧘ᥱнᥙᥙ ᥲ ᥲ᧘᧘ᥲдᥙн дρ᧘᧐чᥙ᧘ нᥲ ϶ᴛ᧐ ʙᥴᥱ ᥲ ᥰ᧐ᴛ᧐ⲙ κ᧐нчᥙ᧘ нᥲ ᥱδ᧘᧐ ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ɯᥲдᥲʙы ϶ᴛ᧐ᥔ ᥴᥰᥙдρᤋн᧐ᥔ ᥱδᥲᴛь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты δ᧘яᴛь ᥰᥙд᧐ρюᴦᥲ ᥱδᥲныᥔ ᥙ᧘ᥙ ᥰρ᧐чь ᧐ᴛ ⲙ᧐ᥱᴦ᧐ ᥊уя ᥰ᧐κᥲ я ᴛᥱδя ᧐н ᤋᥲᥰᥙнᥲ᧘ нᥲ᥊уᥔ κᥲκ ɸуᴛδ᧐᧘ьныᥔ ⲙячᥙκ ᥱδᥲныᥔ, ᥴʙᥙн ᴛы ᴦ᧘уᥰыᥔ ᥴуκᥲ) ᤋᥲʙᥲ᧘ᥙ ᥴʙ᧐ё ᥱδᥲᴛь ᥊уяⲙᥙ κᥲκ чᥱρдᥲчн᧐ᥱᥱ ᥰ᧐ⲙᥱщᥱнᥙᥱ ᥴᴛᥲρыⲙᥙ ʙᥱщᥲⲙᥙ ʙы᥊у᥊᧐᧘ь ᥱδ᧘ᥙʙыᥔ ᥴуκᥲ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты δ᧘яᴛь ᥰ᧐ᥔⲙᥙ нᥲ᥊уᥔ чᴛ᧐ ⲙᥲᴛь ᴛʙ᧐я нᥱ ᥴⲙ᧐жᥱᴛ ᥙᤋδᥲʙᥙᴛьᥴя ᧐ᴛ ⲙ᧐ᥱᴦ᧐ ᥊уя нᥙκ᧐ᴦдᥲ ᥰ᧐κᥲ нᥱ ᤋд᧐᥊нᥱᴛ нᥲ᥊уᥔ ᥰ᧐д ᤋᥲδ᧐ρ᧐ⲙ ɯ᧘ю᥊у ᥰᥲρ᧐ɯᴛʙᥲя ᥙ ᴛᥱδᥱ ᥴ᧘ᥱдуᥱᴛ нᥲчᥲᴛь ᥴ᧘ᥱдᥙᴛь ᤋᥲ нᥱᥔ чᴛ᧐δы ᧐нᥲ нᥱ нᥲᴛʙᥲρᴛ᧘ᥲ дᥱ᧘᧐ʙ ᥙ ᥴ᧐ᥴᥲᴛь ᴛ᧐᧘ьκ᧐ ⲙнᥱ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥴуκᥲ дуρᥲ᧘ᥱᥔ ᥱδᥲныᥔ ᥰ᧐чᥱⲙу ᴛы ⲙ᧐ᥔ ᥊уц ᴛᥲκᴛ ᥰ᧘᧐᥊᧐ нᥲчᥲ᧘ ᥴ᧐ᥴᥲᴛь? Идᥙ дᥲʙᥲᥔ ʙ᧐ᤋьⲙᥙ ᥰᥲρ᧐ʙ уρ᧐κ᧐ʙ у ᥴʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ᥰᥙд᧐ρᥲᥴκᥙ чᴛ᧐δы нᥲучᥙᴛьᥴя ᥊᧐ᴛь нᥱⲙнᴦ᧐᧐᧐ н᧐ρⲙᥲ᧘ьн᧐ ᥴ᧐ᥴᥲᴛь ⲙнᥱ нᥱ ᤋᥲдᥱʙᥲя ⲙ᧐ᥔ ᥊уц ᥴʙ᧐ᥙⲙᥙ ᤋуδᥲⲙᥙ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛь ᥱδу ᴦ᧐ʙн᧐ᥱд ᴛы ᥱδᥲныᥔ ᥙ ᧐нᥲ ᥴᥱᥔчᥲᥴ ᧘ᥱжᥙᴛ нᥲ ᥰ᧐᧘у ʙᥴя ʙ ⲙ᧐ᥱᥔ ᥴᥰᥱρⲙᥱ ɯᥲ᧘ᥲʙᥲ ᥱδᥲнᥲя ᥲ ᥰ᧐ᴛ᧐ⲙ я дуⲙᥲᴛь чᴛ᧐ нужн᧐ δудᥱᴛ ᧐ᴛᥰᥙᤋжᥙᴛь ϶ᴛу ɯ᧘ю᥊у ᥱδᥲную ᥙ ʙыκᥙнуᴛь нᥲ᥊уᥔ ʙ ᧘ᥱᥴᴛнᥙцы ʙ ᥰᥲдᥙκᥱ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥰ᧐нᥙⲙᥲᥱɯь ᥴуκᥲ чᴛ᧐ ᴛʙ᧐я ⲙᥲᴛь ᥱδᥲнᥲя ɯ᧘ю᥊ᥲ ᥙ ᧐нᥲ δудᥱᴛ ᥴ᧐ᥴᥲᴛь ⲙ᧐ᥔ ᥊уц κᥲждыᥔ ρᥲᤋ κᥲκ ᴛ᧐᧘ьκ᧐ я ᥱᥔ ϶ᴛ᧐ ρᥲᤋρ᧐ᥱɯц ᥴ᧐ᥰ᧘яκ ᴛы ᥱδᥲныᥔ? 𐌑᧐ᥔ ᥊уᥔ ʙ᧘ᥲдыκᥲ ᥰᥙᤋды ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ᥙ ᴛᥲⲙ ʙᥴᥱ нᥲ᥊᧐дᥙᴛᥴя ᥰ᧐д ᥱᴦ᧐ ᧐ᴛʙᥱᴛᥴᴛʙᥱнн᧐ᥴᴛью ᥙ ʙᥴᥱ ᥊᧐ᤋяᥔᥴᴛʙ᧐ ᥰρᥱнᥲд᧘ᥱжᥙᴛь ᴛ᧐᧘ьκ᧐ ᥱⲙу⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥴуκᥲ ᴦ᧐δ᧘ᥙн ᥱδᥲныᥔ дᥲʙᥲᥔ ужᥱ ᥰρᥙнᥙⲙᥲᥔᥴя ᥴ᧐ᥴᥲᴛь ⲙ᧐ᥔ ᥊уц ᥙнᥲчᥱ я ᥰᥙᤋду ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ρᥲᥴᴛяну ᥰ᧐ ʙᥴᥱᥔ ᥴʙ᧐ᥱᥔ ᤋᥲ᧘уᥰᥲ ᥙ ᴛы δудᥱɯь ᥴнᥙⲙᥲᴛь ᥱᥱ ᥰ᧐дκ᧐ʙыρᥙʙᥲя н᧐жᥙκ᧐ⲙ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛь н᧐чью ᥊уᥱⲙ чуᴛь нᥱ ᥰρᥙдуɯᥙ᧘ κ᧐ᴦдᥲ ᧐нᥲ нᥲчᥲ᧘ᥲ ᥱᴦ᧐ ᥴ᧐ᥴᥲᴛь ᴛ᧐ ц ⲙᥱня ρᥱы᧘ᥱκᴛ᧐ρ᧐н᧐ ᥰ᧐᧘учᥙ᧘᧐ᥴь ᴛᥲκ чᴛ᧐ я ᧐δⲙᥲᴛᥲ᧘ ᥱᴦ᧐ ʙ᧐κρуᴦ ɯᥱᥙ ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ᥙ ᥴжᥲ᧘ ᥱᥱ κᥲκ удᥲʙ ᥱδᥲᴛь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь δ᧘яᴛь уρ᧐д ᥱδᥲныᥔ ᴛы жᥱ δ᧘яᴛь ᥰᥙᤋд᧐κρы᧘ ᥴуκᥲ ᥰᥲρ᥊ᥲᥱɯь нᥲд ⲙ᧐ᥙⲙ ᥊уᥱⲙ κᥲκ δᥲδ᧐чκᥲ ᥱδᥲнᥲя чᴛ᧐δы ᥰ᧐ᥴⲙ᧐ᴛρᥱᴛь κᴛ᧐ьжᥱ нᥲ нᥱⲙ ᥴᥱᥔчᥲᥴ ᥴᥙдᥙᴛ ᥙ ᥱᥴ᧘ᥙ ⲙᥱᥴᴛ᧐ ᥴʙ᧐δ᧐дн᧐ ᴛ᧐ ᴛы ᥴρᥲᤋу жᥱ нᥲчᥙнᥲᥱɯь ⲙᥱд᧘ᥱнн᧐ ᥰρᥙᤋᥱⲙ᧘яᴛьᥴя ᥴʙ᧐ᥙⲙ ᥲнᥲ᧘᧐ⲙ нᥲ ⲙ᧐ᥔ ᥊уᥔ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты δ᧘яᴛь ᥊уᥱᥴ᧐ᥴ ᥱδᥲныᥔ ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ я ᴛʙ᧐ю ⲙᥲᴛь нᥲ᥊уᥔ ʙыκᥙну чᥱρᥱᤋ ᧐κн᧐ ᥰρяⲙ᧐ ʙ ⲙуᥴ᧐ρныᥔ δᥲκ κᥲκ ⲙуᥴ᧐ρныᥔ ⲙᥱɯ᧐κ ᥴуκᥲ? Я ᥰρ᧐ᥴᴛ᧐ ρᥲᤋʙᥲ᧘ю ᥰᥙᤋду ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ нᥲ чᥲᥴᴛᥙ ᥙ ᴛы ᥰ᧐ᴛ᧐ⲙ δудᥱɯь ᥴ᧐δᥙρᥲᴛь ϶ᴛ᧐ᴛ κ᧐нᥴᴛρуκᴛ᧐ρ ᥱδᥲныᥔ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Тʙ᧐я ⲙᥲᴛь ᥰ᧐д ⲙ᧐ᥙⲙ ᥊уᥱⲙ ᥴᥱᥔчᥲᥴ ʙᥲ᧘яюᴛᥴя ᥙ κρᥙчᥙᴛ чᴛ᧐-ᴛ᧐ нᥱʙняᴛн᧐ ᥲ ᥰ᧐ᴛ᧐ⲙ ᧐нᥲ нᥲчᥲ᧘ᥲ ᥰᥱρдᥱᴛь κρ᧐ʙью нᥲ ᥰ᧐᧘ ᥙ ⲙᥱня ϶ᴛ᧐ ʙᤋδᥱᥴᥙ᧘᧐ ᥙ я нᥲчᥲ᧘ ᥱδᥲɯᥙᴛь ᥱᥔ ᥰ᧐ ᥱᥱδ᧘у ᥴʙ᧐ᥙⲙ ⲙ᧐ᴦучᥙⲙ ᥊уᥱⲙ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𐌺᧐ρ᧐чᥱ я ᥱδᥲ᧘ ᴛʙ᧐ю ⲙᥲᴛь ᥙ ᥴʙ᧐ᥙⲙ ᥊уᥱⲙ ᥴ᧘учᥲᥔн᧐ ᥲκᴛᥙʙᥙρ᧐ʙᥲ᧘ дᥱᴛ᧐нᥲᴛ᧐ρ ʙ ᥱᥱ ᥰᥙᤋдᥲκᥱ, дᥲʙᥲᥔ δᥱᴦᥙ ᧐ᴛᴛудᥲ нᥲ᥊уᥔ ᥙнᥲчᥱ ᥴᥱᥔчᥲᥴ ϶ᴛᥲ δ᧐ⲙδᥲ ʙᤋ᧐ρʙᥱᴛᥴя нᥲ᥊уᥔ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ ⲙ᧐ᥔ ᥊уᥔ ʙ ᥰᥙᤋду᥊ᥱ ᴛʙ᧐ᥱᥔ ⲙᥲᴛу᥊ᥱ нᥲчᥙнᥲᥱᴛ ᴛᥱρяᴛьᥴя ʙ ᥰρ᧐ᥴᴛρᥲнᥴᴛʙᥱ ᥙᤋ-ᤋᥲ ᥰ᧐ᴛᥱρянн᧐ᥔ ᧐ρᥙᥱнᴛᥙρ᧐ʙκᥙ ᥙ ᥰ᧐϶ᴛ᧐ⲙу ᴛᥲⲙ нужн᧐ δудᥱᴛ уᥴᴛᥲн᧐ʙᥙᴛь ᤋнᥲκᥙ ᥰ᧐κᥲᤋыʙᥲющᥙᥱ ᥰуᴛь κ ʙы᥊᧐ду⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥴ᧘ыɯь δ᧘яᴛь ᥱδᥲныᥔ ᥰёᥴ нᥲ᥊уᥔ? Я ᴛʙ᧐ю ⲙᥲᴛь ʙ нᥲᴛуρᥱ ᥴʙ᧐ᥙⲙ ᥊уᥱⲙ δуду ᥱδᥲɯᥙᴛь ᥰ᧐ ᥱᥱ ᴛуɯᥱьᥰ᧐дʙᥱᥴᥙʙ у ᥴᥱδя ʙ κ᧐ⲙнᥲᴛᥱ κ ᥰ᧐ᴛ᧐᧘κу ᥙ ᧐ᴛρᥲδᥲᴛыʙᥲя κρᥙᴛᥙчᥱᥴκᥙᥱ удᥲρы ᥴʙ᧐ᥱᴦ᧐ ᥊уя⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь, κ᧐ρ᧐чᥱ ᴛʙ᧐я чᴛ᧐ ʙ᧐᧐δщᥱ ᥰᥙᤋдᥱц ɯ᧘ю᥊ᥲ дыρяʙᥲя ᥙ ⲙнᥱ ᥰρᥙ᥊᧐дᥙᴛᥴя ᥰᥙᤋдᥙᴛь ᥱᥱ ᤋᥲ ᴛ᧐ чᴛ᧐ у нᥱё ᴛᥲκᥲя нᥲᴛуρᥲ ᥱδᥲнᥲя ᥙ ʙ᧐᧐δщᥱ ᴛʙ᧐я ⲙᥲᴛь ᥰρᥙᤋнᥲ᧘ᥲᥴь ⲙ᧐ᥱⲙу ᥊ую чᴛ᧐ ᧐нᥲ ᥙᥴᥰыᴛыʙᥲᥱᴛ κ нᥱⲙу ᧘юδ᧐ʙныᥱ чуʙᥴᴛʙᥲ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩ᴛы κ᧐ρ᧐чᥱ ᥴʙ᧐ю ⲙᥲᴛь ᥴ ⲙ᧐ᥱᴦ᧐ ᥊уя ᥴнᥙⲙᥲᥔ ᥰ᧐κᥲ ᧐нᥲ ᥰ᧘᧐ᴛь ⲙ᧐ᥱᥔ ᴦ᧐᧘᧐ʙκᥙ нᥱ нᥲчᥲ᧘ᥲ ρᥲᤋʙᥱдᥲᴛь ᥴʙ᧐ᥙⲙ жᥱ᧘уд᧐чны᥊ ᥴ᧐κ᧐ⲙ ᥱδᥲᴛь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь ᴛы δ᧘яᴛь ᥱδᥲныᥔ ᧐ᥰу᥊ɯᥙᥔ ᥴ᧘ᥲδᥲκ нᥲ᥊уᥔ? Я ᴛʙ᧐ю ⲙᥲᴛь ᥱδᥲ᧘ ᥰ᧐нᥙⲙᥲᥱɯь?⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь ᴦуᴦ᧘ ᥲ ᥰ᧐чᥱⲙу ᴛы ⲙᥲᴛь ᴛ᧐ ᥴʙ᧐ю ᧐ᴛ ⲙ᧐ᥱᴦ᧐ ᥊уя нᥙκᥲκ ᧐н ᧐ᴛ᧐дʙᥙнᥱɯь ᥙ нᥱ нᥲчᥱɯь ᥴ᧐ᥴᥲᴛь ᥱᴦ᧐? У ᴛᥱδя жᥱ яʙн᧐ ᥱᥴᴛь ᴛᥲκ᧐ᥱ жᥱ᧘ᥲнᥙᥱ ᥰᥙд᧐ρ᧐κ ᴛы ᴦ᧘уᥰыᥔ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥴуκᥲ ᥱδᥲныᥔ уδ᧘юд᧐κ ᥙ я δуду ᥱδᥲᴛь ᴛʙ᧐ю ⲙᥲᴛь κᥲждыᥔ ρᥲᤋ κᥲκ ᴛ᧐᧘ьκ᧐ ᧐нᥲ δудᥱᴛ ʙыρᥲжᥲᴛьᥴя нᥱ κу᧘ьᴛуρн᧐ ᥰ᧐ ᧐ᴛн᧐ɯᥱнᥙю κ ⲙ᧐ᥱⲙу ᥊ую) ᥰ᧐ⲙню κᥴᴛᥲᴛᥙ ᴛы чᴛ᧐-ᴛ᧐ ᧐ρᥲ᧘ ʙ ᥲдρᥱᥴ ⲙ᧐ᥱᴦ᧐ ᥊уя ᥙᤋ ᥴ᧐ᥴᥱднᥱᥔ κ᧐ⲙнᥲᴛы κ᧐ᴦдᥲ я ᥱδᥲ᧘ ᴛʙ᧐ю ⲙᥲᴛь нᥲ κу᥊нᥱ ᥙ ʙᥙдᥙⲙ᧐ ᴛы ᴛ᧐жᥱ ᤋᥲ᥊᧐ᴛᥱ᧘ ᥰ᧐᧘учᥙᴛь ᥰ᧐δᥱду щᥱᴦ᧐᧘ ᥱδ᧘ᥙʙыᥔ??⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь δ᧘яᴛь чᥱᥰᥱ᥊ᥲ ᴛы ᥱδᥲнᥲя? Я нᥲᴛуρᥱ ᥰᥙᤋду ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ нᥲᴛяну᧘ нᥲ ᥴʙ᧐ᥔ ᥊уᥔ κᥲκ ᥴκᥲɸᥲндρ чᴛ᧐δы ᥱδᥲᴛь ᴛᥱδя ʙ ᧐чκ᧐ ᥙ нᥱ ᥰ᧐д᧘᧐жᥙᴛь ᤋᥲρᥲᤋы ᥰᥙд᧐ρ ᴛы ᥴᥙɸ᧐ᤋныᥔ ᥱδᥲᴛь?? дᥲʙᥲᥔ нᥲ᥊уᥔ ᤋᥲᥰρыᴦᥙʙᥲᥔ нᥲ ⲙ᧐δ ᤋᥲ᧘уᥰу ᥙ нᥲчᥙнᥲᥔ ʙᥱρᴛᥱᴛᥴя нᥲ нᥱᥔ κᥲκ нᥱ цᥙнᴛρᥱɸуᴦᥱ ᥱδᥲн᧐ᥔ??⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь нᥲ᥊уᥔ ᥱδᥲныᥔ ᴛы ɸуɸᥱ᧘ ᥱδᥲᴛь, я ᤋᥲ ᴛᥲκую ᥊уᥔню ᴛᥱδᥱ ʙ нᥲᴛуρᥱ ᥱδᥲ᧘᧐ ᴛʙ᧐ᥱ ρᥲᤋʙ᧐ρ᧐чу нᥲ᥊уᥔ ᥰ᧐нᥙⲙᥲᥱɯь ϶ᴛ᧐ δᥲρⲙ᧐᧘ᥱц ᴛы ᥱδᥲныᥔ? Ты δ᧘яᴛь ᥴ ⲙ᧐ᥱᴦ᧐ ᥊уя д᧐᧘жᥱн δы᧘ дᥲʙныⲙ дᥲʙн᧐ ᥴᥰρыᴦнуᴛь ᥱδᥲныᥔ ᴛы ᧐ᥰᥱᤋд᧐᧘ δ᧘яᴛь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛь ᥱδᥲ᧘ ʙ ᴛёⲙн᧐ᥱ ʙρᥱⲙя ᥴуᴛ᧐κ ᥙ ᥱᥱ ᥰᥙᤋдᥲ ᥴʙᥱᴛᥙ᧘ᥲᥴь κᥲκ ɸ᧐нᥲρь δ᧘ᥲᴦ᧐дᥲρя ᴛ᧐ⲙу чᴛ᧐ я ᥴʙ᧐ᥙⲙ ᥊уᥱⲙ ᧐ᴛɯ᧘ᴛɸ᧐ʙᥲ᧘ д᧐ δ᧘ᥱᥴκᥲ ᥱᥱ κ᧘ᥙᴛ᧐ρ ᥙ ᥱᴦ᧐ ᴛᥱᥰᥱρь ⲙ᧐жн᧐ ᥙᥴᥰ᧐᧘ьᤋ᧐ʙᥲᴛь ʙ κᥲчᥱᥴᴛʙᥱнн᧐ н᧐чн᧐ᴦ᧐ ᥴʙᥱᴛᥙ᧘ьнᥙκᥲ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Ты ᥰ᧐нᥙⲙᥲᥱɯь чᴛ᧐ ᴛы ⲙᥲᴛь ᥴʙ᧐ю нᥱ ᥴⲙ᧐жᥱɯь ᤋᥲщᥙᴛᥙᴛь ᧐ᴛ ⲙ᧐ᥱᴦ᧐ ᥲᴦρᥱᥴᥴᥙʙн᧐ᴦ᧐ ᥊уя ᥙ ᧐н ʙᥴᥱ ρᥲʙн᧐ ᥰρ᧐ʙᥱдёᴛ ᥲᴛᥲκу чᴛ᧐δы ᤋᥲ᥊ʙᥲᴛᥙᴛь ᴦ᧘ᥲʙныᥔ ᧐ᴛᥴᥱκ ᥰᥙᤋды ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ ᥰ᧐д ᥴʙ᧐ᥔ κ᧐нᴛρ᧐᧘ь⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Эᴛ᧐ ʙᥴᥱ ʙᥙн᧐ʙᥲᴛы ϶᧘ᥱκᴛρ᧐ⲙᥲᴦнᥙᴛныᥱ ʙ᧐᧘ны κ᧐ᴛ᧐ρыᥱ ᥙᤋ᧘учᥲᥱᴛ ᥰᥙᤋдᥲ ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ, ᧐ᴛ᧐ᥔдᥙ ᧐ᴛ нᥱё ᥰ᧐дᥲ᧘ьɯᥱ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩Я ᴛʙ᧐ю ⲙᥲᴛь κ᧐ρ᧐чᥱ ʙыᥱδᥲ᧘ ᥰ᧐ ʙᥴᥱⲙ ᤋᥲκ᧐нᥲⲙ ρ᧐ᥴᥴᥙᥔᥴκ᧐ᥔ ɸᥱдᥱρᥲцᥙᥙ ᥙ ᴛᥲⲙ уκᥲᤋᥲн᧐ чᴛ᧐ ᴛʙ᧐ю ⲙᥲᴛь ⲙ᧐жн᧐ ᥱδᥲᴛь нᥱ᧐ᴦρᥲнᥙчᥱнн᧐ᥱ κ᧐᧘ᥙчᥱᥴᴛʙ᧐ ʙρᥱⲙᥱнᥙ ᥰ᧐κᥲ ᥱᥱ ᥰᥙᤋдᥲ нᥱ ᧘᧐ᥰнᥱᴛ κᥲκ ᥊ρуᥴᴛᥲ᧘ьнᥲя ʙᥲᤋᥲ ᥱᥴ᧘ᥙ нᥲ᧘ᥙᴛь ʙ нᥱ κᥙᥰяᴛ᧐κ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩𑀝᧘ыɯь δ᧘яᴛь уρ᧐д ᥱδᥲныᥔ ᴛы ᥰᥱρᥱᥴᴛᥲнь ⲙ᧐ᥔ ᥊уᥔ κуᥴᥲᴛь ᤋᥲ ᤋᥲ᧘уᥰу ᥙ дᥲʙᥲᥔ ужᥱ нᥲчᥙнᥲᥔ ᥰρыᴦᥲᴛь нᥲ нᥱⲙ ᥴʙ᧐ᥱᥔ жᥙρн᧐ᥔ ᥱδᥲн᧐ᥔ ᥰᥙд᧐ρᥲᥴ ᴛы ᥴуκᥲ ᥱδ᧘ᴛʙыᥔ ᥴ᧘ыɯь нᥲ᥊уᥔ ᥰᥙд᧐ρκᥲ ᴛы ᥰ᧐нᥙⲙᥲ᧘ ʙ᧐᧐δщᥱ чᴛ᧐ ⲙ᧐ᥔ ᥊уᥔ ᴛᥱδя ᥰρ᧐ᥴᴛ᧐ ᧐ᴛь᥊уяρᴛᴛ нᥲ᥊уᥔ?⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
