'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩ⲙы ᴛуᴛ ᥴ ᥰᥲцᥲнᥲⲙᥙ ρᥱɯᥙ᧘ᥙ ʙ ᧐дн᧐ κᥲᥴᥲнᥙᥱ ᥰ᧐ᥙᴦρᥲᴛь ᥴ κ᧘ᥙᴛ᧐ρ᧐ⲙ ᴛʙ᧐ᥱᥔ ⲙᥲᴛᥱρᥙ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
'[<emoji document_id=5375318271509668027>💙</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=5386798809286189971>🌊</emoji>⟩ᴛʙ᧐я ⲙᥲᴛь ɯ᧘ᥲ, ᥴᥰ᧐ᴛыκну᧘ᥲᥴь ᧐δю ᥙ᧐ᥔ ᥊уᥔ, ᥙ ᥰρ᧐ʙᥲ᧘ᥙ᧘ᥲᥴь ʙ κᥲнᥲ᧘ᥙᤋᥲцᥙ᧐нную яⲙу, ᴦдᥱ ᥱё ᥴᥰᥲᥴᥲ᧘ ᧐ᴛρяд ᥴᥲнᥙᴛᥲρны᥊ ρᥲδ᧐чᥙ᥊',
'δ᧘яᴛь ᴛы ᤋᥲᥱδᥲ᧘ уⲙρᥙ ужᥱ ᴦдᥱ нᥙδудь уᥱδ᧐κ) ᥴуκᥲ δ᧐ⲙᥲρᥲ ᴛы ᥱδᥲннᥲя, я ᴛʙ᧐ю ⲙᥲⲙᥲɯκу ᥱδᥲ᧘ нᥲ ᤋᥲᥰρᥲʙκᥱ⟨<emoji document_id=5386798809286189971>🌊</emoji>|<emoji document_id=5332518162195816960>❄️</emoji>|<emoji document_id=6037464823959129840>🩸</emoji>|<emoji document_id=5192891734635322759>💦</emoji>|<emoji document_id=5375318271509668027>💙</emoji>]',
